CREATE TABLE ofertacompleta1920(
   ensenanza    VARCHAR(60) NOT NULL 
  ,curso        INTEGER  NOT NULL
  ,codmodalidad VARCHAR(6)
  ,modalidad    VARCHAR(65) NOT NULL
  ,turno        VARCHAR(17) NOT NULL
  ,dencentro    VARCHAR(58) NOT NULL
  ,codcentro    INTEGER  NOT NULL
  ,nombrecentro VARCHAR(57) NOT NULL
  ,provincia    VARCHAR(8) NOT NULL
  ,localidad    VARCHAR(27) NOT NULL
  ,ngrupos      VARCHAR(4)
  ,nmatriculado INTEGER  NOT NULL,
primary key(modalidad,codcentro,turno,curso)
);
